extern crate rand;
extern crate bn;
mod serialization;

use bn::*;
use self::serialization::*;

#[test]
fn serialization_and_deserialization() {
    let mut a = Fq2::one();
    let b = Fq2::random(&mut rand::thread_rng());

    for _ in 0..10000 {
        a = a * b;

        assert_eq!(reserialize(a), a);
    }
}

